import React, { useState } from 'react';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const COLUMNS = {
  orderId: 'Order ID',
  purchaseTimestamp: 'Purchase Timestamp',
  reviewScore: 'Review Score',
  deliveredOnTime: 'Delivered On Time',
  paymentType: 'Payment Type',
  paymentValue: 'Payment Value',
  shippingCost: 'Shipping Cost',
  productCategory: 'Product Category',
  customerState: 'Customer State',
  customerId: 'Customer ID',
  orderStatus: 'Order Status',
  deliveryDurationDays: 'Time to Deliver to Customer Days'
};

const AdvancedDiagnosticTool = () => {
  const [tests, setTests] = useState([]);
  const [isRunning, setIsRunning] = useState(false);
  const [expandedTest, setExpandedTest] = useState(null);
  const [allData, setAllData] = useState([]);

  const addTest = (name, status, details = {}) => {
    setTests(prev => [...prev, { id: Date.now() + Math.random(), name, status, details, timestamp: new Date().toLocaleTimeString() }]);
  };

  const clearTests = () => setTests([]);

  const runFullDiagnostics = async () => {
    clearTests();
    setIsRunning(true);
    setAllData([]);

    try {
      // TEST 1: Check API info endpoint (might have metadata)
      addTest('API - Checking for metadata/info endpoint', 'RUNNING', {});
      try {
        const infoResponse = await fetch(`${API_BASE_URL}/info`);
        if (infoResponse.ok) {
          const info = await infoResponse.json();
          addTest('API - Found Info Endpoint', 'PASS', {
            info: info
          });
        } else {
          addTest('API - Info Endpoint Not Found', 'PASS', {
            status: infoResponse.status,
            suggestion: 'No /info endpoint - trying alternative methods'
          });
        }
      } catch (err) {
        addTest('API - Info Endpoint Check', 'PASS', {
          note: 'No /info endpoint available'
        });
      }

      // TEST 2: Check for pagination parameters
      addTest('API - Testing Pagination Parameters', 'RUNNING', {});
      const paginationTests = [
        { url: `${API_BASE_URL}/data?limit=1000`, name: 'limit=1000' },
        { url: `${API_BASE_URL}/data?page=1&limit=10000`, name: 'page=1&limit=10000' },
        { url: `${API_BASE_URL}/data?offset=0&limit=50000`, name: 'offset=0&limit=50000' },
        { url: `${API_BASE_URL}/data?skip=0&take=50000`, name: 'skip=0&take=50000' },
      ];

      let bestUrl = null;
      let bestCount = 0;

      for (const test of paginationTests) {
        try {
          const response = await fetch(test.url);
          if (response.ok) {
            const data = await response.json();
            const count = Array.isArray(data) ? data.length : 0;
            addTest(`API - Pagination Test: ${test.name}`, count > 0 ? 'PASS' : 'FAIL', {
              url: test.url,
              recordsReturned: count,
              suggestion: count > 0 ? `This parameter works! Returns ${count} records` : 'Parameter accepted but no data'
            });
            if (count > bestCount) {
              bestCount = count;
              bestUrl = test.url;
            }
          }
        } catch (err) {
          addTest(`API - Pagination Test: ${test.name}`, 'FAIL', {
            error: err.message
          });
        }
      }

      // TEST 3: Fetch with best URL or default
      addTest('API - Fetching Data', 'RUNNING', {});
      let rawData = [];
      try {
        const urlToUse = bestUrl || `${API_BASE_URL}/data`;
        const response = await fetch(urlToUse);
        if (!response.ok) {
          throw new Error(`HTTP ${response.status}`);
        }
        rawData = await response.json();
        if (!Array.isArray(rawData)) {
          throw new Error('Response is not an array');
        }
        addTest('API - Data Fetch Success', 'PASS', {
          urlUsed: urlToUse,
          recordsReturned: rawData.length,
          expectedTotal: 118943,
          gapWarning: rawData.length < 118943 ? 'MISSING DATA - May need pagination' : 'All data loaded'
        });
        setAllData(rawData);
      } catch (err) {
        addTest('API - Data Fetch Failed', 'FAIL', {
          error: err.message,
          urlTested: `${API_BASE_URL}/data`,
          suggestion: 'Check backend server logs'
        });
        setIsRunning(false);
        return;
      }

      // TEST 4: Data structure check
      if (rawData.length > 0) {
        addTest('Data - Structure Validation', 'PASS', {
          totalRecords: rawData.length,
          firstRecordKeys: Object.keys(rawData[0]),
          sampleRecord: rawData[0]
        });

        // TEST 5: Revenue calculation
        addTest('Calculation - Total Revenue', 'RUNNING', {});
        let totalRevenue = 0;
        let validRecords = 0;
        let invalidRecords = 0;

        rawData.forEach(d => {
          const val = parseFloat(d[COLUMNS.paymentValue]);
          if (isNaN(val)) {
            invalidRecords++;
          } else {
            totalRevenue += val;
            validRecords++;
          }
        });

        addTest('Calculation - Total Revenue', 'PASS', {
          totalRecords: rawData.length,
          validPaymentRecords: validRecords,
          invalidPaymentRecords: invalidRecords,
          percentageValid: ((validRecords / rawData.length) * 100).toFixed(1) + '%',
          totalRevenue: totalRevenue,
          formattedRevenue: `$${totalRevenue.toLocaleString('en-US', { maximumFractionDigits: 2 })}`,
          averageOrderValue: `$${(totalRevenue / validRecords).toFixed(2)}`
        });

        // TEST 6: Orders
        addTest('Calculation - Total Orders', 'PASS', {
          totalOrders: rawData.length,
          expectedOrders: 118943,
          difference: 118943 - rawData.length,
          percentageOfTotal: ((rawData.length / 118943) * 100).toFixed(1) + '%',
          warning: rawData.length < 118943 ? 'âš ï¸ MISSING DATA - Backend may have pagination limit' : 'âœ“ All records loaded'
        });

        // TEST 7: Review scores
        addTest('Calculation - Review Score Analysis', 'PASS', {
          recordsWithReview: rawData.filter(d => !isNaN(parseFloat(d[COLUMNS.reviewScore]))).length,
          averageReview: (rawData.reduce((sum, d) => sum + (parseFloat(d[COLUMNS.reviewScore]) || 0), 0) / rawData.length).toFixed(2)
        });

        // TEST 8: State distribution
        const stateMap = {};
        rawData.forEach(d => {
          const state = d[COLUMNS.customerState];
          if (state) {
            stateMap[state] = (stateMap[state] || 0) + 1;
          }
        });

        addTest('Data - State Distribution', 'PASS', {
          uniqueStates: Object.keys(stateMap).length,
          totalStateRecords: Object.values(stateMap).reduce((a, b) => a + b, 0),
          topStates: Object.entries(stateMap)
            .sort((a, b) => b[1] - a[1])
            .slice(0, 5)
            .map(([state, count]) => ({ state, count }))
        });
      }

      // TEST 9: Pagination capability check
      addTest('API - Pagination Capability Check', 'RUNNING', {});
      if (rawData.length === 10000) {
        addTest('API - Pagination Capability Check', 'FAIL', {
          issue: 'Exactly 10,000 records returned - suggests default limit',
          expectation: 'Should return 118,943 records total',
          possibleCauses: [
            'Backend has a 10,000 record default limit',
            'Pagination not implemented on frontend',
            'API requires explicit pagination parameters',
            'API requires authentication headers'
          ],
          solutions: [
            '1. Try different limit parameters (?limit=100000, ?take=150000)',
            '2. Try offset/page parameters (?offset=0&limit=50000)',
            '3. Check if API supports /count endpoint for total records',
            '4. Ask backend team about pagination implementation',
            '5. Check for batch or export endpoints'
          ]
        });
      } else if (rawData.length < 10000) {
        addTest('API - Pagination Capability Check', 'FAIL', {
          issue: `Only ${rawData.length} records returned`,
          expectation: 'Should return 118,943 records total',
          recommendation: 'Backend API needs to implement pagination or increase limit'
        });
      } else {
        addTest('API - Pagination Capability Check', 'PASS', {
          recordsReturned: rawData.length,
          expectation: 118943,
          status: 'Full dataset returned'
        });
      }

      addTest('DIAGNOSTIC COMPLETE', 'PASS', { 
        recordsLoaded: rawData.length,
        missingRecords: Math.max(0, 118943 - rawData.length),
        nextSteps: 'Check test results above. Red X marks indicate the problem.'
      });

    } catch (err) {
      addTest('FATAL ERROR', 'FAIL', { error: err.message, stack: err.stack });
    } finally {
      setIsRunning(false);
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'PASS': return '#10b981';
      case 'FAIL': return '#ef4444';
      case 'RUNNING': return '#f59e0b';
      default: return '#cbd5e1';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'PASS': return 'âœ“';
      case 'FAIL': return 'âœ—';
      case 'RUNNING': return 'âŸ³';
      default: return 'â—‹';
    }
  };

  const downloadJSON = () => {
    const dataStr = JSON.stringify(allData, null, 2);
    const dataBlob = new Blob([dataStr], { type: 'application/json' });
    const url = URL.createObjectURL(dataBlob);
    const link = document.createElement('a');
    link.href = url;
    link.download = `api-data-${new Date().toISOString().slice(0, 10)}.json`;
    link.click();
  };

  return (
    <div style={{ minHeight: '100vh', background: 'linear-gradient(to bottom right, #0f172a, #1e293b)', padding: '2rem', fontFamily: 'system-ui, -apple-system, sans-serif' }}>
      <div style={{ maxWidth: '1200px', margin: '0 auto' }}>
        <div style={{ background: '#1e293b', borderRadius: '12px', padding: '2rem', border: '1px solid #475569', marginBottom: '2rem' }}>
          <h1 style={{ color: '#60a5fa', margin: '0 0 0.5rem 0', fontSize: '2rem', fontWeight: 'bold' }}>
            ðŸ”§ Advanced API Diagnostic Tool
          </h1>
          <p style={{ color: '#cbd5e1', margin: '0 0 1.5rem 0' }}>
            Expected: <strong>118,943 orders</strong> | Currently Getting: <strong>{allData.length.toLocaleString()}</strong>
            {allData.length < 118943 && <span style={{ color: '#ef4444', marginLeft: '1rem' }}>Missing {(118943 - allData.length).toLocaleString()} records!</span>}
          </p>

          <div style={{ display: 'flex', gap: '1rem', marginBottom: '2rem', flexWrap: 'wrap' }}>
            <button
              onClick={runFullDiagnostics}
              disabled={isRunning}
              style={{
                padding: '0.75rem 1.5rem',
                background: isRunning ? '#64748b' : '#2563eb',
                color: 'white',
                border: 'none',
                borderRadius: '8px',
                cursor: isRunning ? 'not-allowed' : 'pointer',
                fontWeight: 'bold',
                fontSize: '1rem'
              }}
            >
              {isRunning ? 'âŸ³ Running Tests...' : 'â–¶ Run Full Diagnostics'}
            </button>

            <button
              onClick={clearTests}
              disabled={isRunning || tests.length === 0}
              style={{
                padding: '0.75rem 1.5rem',
                background: tests.length === 0 ? '#64748b' : '#f59e0b',
                color: 'white',
                border: 'none',
                borderRadius: '8px',
                cursor: tests.length === 0 ? 'not-allowed' : 'pointer',
                fontWeight: 'bold'
              }}
            >
              Clear Results
            </button>

            <button
              onClick={downloadJSON}
              disabled={allData.length === 0}
              style={{
                padding: '0.75rem 1.5rem',
                background: allData.length === 0 ? '#64748b' : '#10b981',
                color: 'white',
                border: 'none',
                borderRadius: '8px',
                cursor: allData.length === 0 ? 'not-allowed' : 'pointer',
                fontWeight: 'bold'
              }}
            >
              ðŸ“¥ Download Data as JSON
            </button>
          </div>

          {tests.length > 0 && (
            <div style={{ marginTop: '1.5rem', padding: '1rem', background: '#0f172a', borderRadius: '8px', border: '1px solid #475569' }}>
              <div style={{ color: '#22d3ee', fontWeight: 'bold', marginBottom: '1rem' }}>
                Results: {tests.length} tests run
              </div>

              {tests.map((test) => (
                <div
                  key={test.id}
                  style={{
                    marginBottom: '0.5rem',
                    border: `2px solid ${getStatusColor(test.status)}`,
                    borderRadius: '6px',
                    overflow: 'hidden'
                  }}
                >
                  <div
                    onClick={() => setExpandedTest(expandedTest === test.id ? null : test.id)}
                    style={{
                      display: 'flex',
                      alignItems: 'center',
                      gap: '1rem',
                      padding: '1rem',
                      background: `${getStatusColor(test.status)}20`,
                      cursor: 'pointer',
                      userSelect: 'none'
                    }}
                  >
                    <span
                      style={{
                        color: getStatusColor(test.status),
                        fontWeight: 'bold',
                        fontSize: '1.2rem',
                        width: '24px',
                        textAlign: 'center'
                      }}
                    >
                      {getStatusIcon(test.status)}
                    </span>
                    <span style={{ color: '#e2e8f0', fontWeight: '600', flex: 1 }}>
                      {test.name}
                    </span>
                    <span style={{ color: '#94a3b8', fontSize: '0.85rem' }}>
                      {test.timestamp}
                    </span>
                    <span style={{ color: getStatusColor(test.status), fontWeight: 'bold' }}>
                      {expandedTest === test.id ? 'â–¼' : 'â–¶'}
                    </span>
                  </div>

                  {expandedTest === test.id && (
                    <div style={{ padding: '1rem', background: '#1e293b', color: '#cbd5e1', fontSize: '0.875rem', borderTop: `1px solid ${getStatusColor(test.status)}` }}>
                      <pre
                        style={{
                          margin: 0,
                          whiteSpace: 'pre-wrap',
                          wordBreak: 'break-word',
                          fontFamily: 'monospace',
                          background: '#0f172a',
                          padding: '0.75rem',
                          borderRadius: '4px',
                          overflow: 'auto',
                          maxHeight: '600px'
                        }}
                      >
                        {JSON.stringify(test.details, null, 2)}
                      </pre>
                    </div>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>

        <div style={{ background: '#1e293b', borderRadius: '12px', padding: '1.5rem', border: '1px solid #475569', color: '#cbd5e1', fontSize: '0.875rem' }}>
          <h3 style={{ color: '#60a5fa', marginTop: 0 }}>âš¡ Key Issue Found:</h3>
          <p style={{ color: '#ef4444', fontWeight: 'bold' }}>
            Your backend is only returning 10,000 records when you have 118,943 total.
          </p>

          <h3 style={{ color: '#60a5fa' }}>ðŸ”§ What This Tool Does:</h3>
          <ul style={{ marginLeft: '1.5rem', lineHeight: '1.8' }}>
            <li>Tests different pagination parameters</li>
            <li>Checks if API has metadata endpoints</li>
            <li>Fetches as much data as possible</li>
            <li>Calculates actual totals from retrieved data</li>
            <li>Shows exactly what's missing</li>
            <li>Allows you to download the fetched data</li>
          </ul>

          <h3 style={{ color: '#60a5fa' }}>ðŸ’¡ Solutions to Try:</h3>
          <ol style={{ marginLeft: '1.5rem', lineHeight: '2' }}>
            <li><strong>Ask your backend team:</strong> "How do I get all 118,943 records? What pagination parameters does /api/data support?"</li>
            <li><strong>Try different parameters:</strong> limit, offset, page, skip, take, per_page</li>
            <li><strong>Check for batch endpoint:</strong> Maybe there's /api/data/export or /api/data/all</li>
            <li><strong>Increase the limit:</strong> ?limit=200000 or similar</li>
            <li><strong>Multiple requests:</strong> Fetch in batches with offset/limit</li>
          </ol>

          <h3 style={{ color: '#60a5fa' }}>ðŸ“Š What the KPIs Should Be:</h3>
          <p style={{ fontFamily: 'monospace', background: '#0f172a', padding: '1rem', borderRadius: '6px' }}>
            Once you get all 118,943 records:
            <br/>Total Orders: 118,943
            <br/>Real Total Revenue: [will calculate correctly]
            <br/>Real Average Order Value: [will calculate correctly]
          </p>
        </div>
      </div>
    </div>
  );
};

export default AdvancedDiagnosticTool;
